import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';

function QuizListTable() {
    const [quizzes, setQuizzes] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await axios.get('http://127.0.0.1:8000/api/quizzes/');
                setQuizzes(Array.isArray(response.data) ? response.data : response.data.results || []);
            } catch (error) {
                setError(error);
            } finally {
                setLoading(false);
            }
        };
        fetchData();
    }, []);

    if (loading) return (
        <div className="d-flex justify-content-center m-5">
            <div className="spinner-border" role="status">
                <span className="visually-hidden">Loading...</span>
            </div>
        </div>
    );

    if (error) return (
        <div className="alert alert-danger m-3" role="alert">
            Error loading quizzes: {error.message}
        </div>
    );

    return (
        <div className="container-fluid py-4">
            <div className="row">
                <div className="col-lg-8">
                    <div className="card">
                        <div className="card-header">
                            <h5 className="card-title mb-0">Quiz List</h5>
                        </div>
                        <div className="card-body">
                            <div className="table-responsive">
                                <table className="table table-hover table-striped">
                                    <thead className="table-light">
                                        <tr>
                                            <th scope="col">#</th>
                                            <th scope="col">Title</th>
                                            <th scope="col">Description</th>
                                            <th scope="col">Created At</th>
                                            <th scope="col">Actions</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {quizzes.map(quiz => (
                                            <tr key={quiz.id}>
                                                <td>{quiz.id}</td>
                                                <td>{quiz.title}</td>
                                                <td>{quiz.description}</td>
                                                <td>{new Date(quiz.created_At).toLocaleDateString()}</td>
                                                <td>
                                                    <button className="btn btn-sm btn-primary me-2">
                                                        Take Quiz
                                                    </button>
                                                    <button className="btn btn-sm btn-info">
                                                        View Details
                                                    </button>
                                                </td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </table>
                            </div>
                        </div>
                    </div>
                </div>
                <div className="col-lg-4">
                    <div className="card">
                        <div className="card-header bg-primary text-white">
                            <h5 className="card-title mb-0">Leaderboard</h5>
                        </div>
                        <div className="card-body">
                            <div className="list-group">
                                {/*
                                    Dummy data for leaderboard
                                    Replace with real data as needed
                                */}
                                {{
                                    name: "John Doe",
                                    score: 95
                                },
                                {
                                    name: "Jane Smith",
                                    score: 90
                                },
                                {
                                    name: "Bob Wilson",
                                    score: 85
                                },
                                {
                                    name: "Alice Brown",
                                    score: 80
                                },
                                {
                                    name: "Tom Davis",
                                    score: 75
                                }
                                }.map((player, index) => (
                                    <div key={index} className="list-group-item d-flex justify-content-between align-items-center">
                                        <div>
                                            <span className="badge bg-secondary me-2">#{index + 1}</span>
                                            {player.name}
                                        </div>
                                        <span className="badge bg-primary rounded-pill">{player.score}</span>
                                    </div>
                                ))}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default QuizListTable;
